import "./TopRightMenu.css";
import pancake from "../../Images/pancake.jpeg";

function MenuTopRight() {
  return (
    <>
      <img src={pancake} alt="pancake-dessert"/>
      <div className="top-right">
        <h1 className="top-right-name">Pancake</h1>
        <p className="top-right-description">
          Млечно - Бело - Темно чоколадо, банана, јагода, пченично брашно,
          путер, млеко, квасец, сол, шеќер, јајца, ванилин, вода.
        </p>
        <h6 className="top-right-alergy">АЛЕРГЕН: Млеко, глутен, кикирики, јајца</h6>
        <h1 className="top-right-price">230den</h1>
      </div>
    </>
  );
}

export default MenuTopRight;
